import React from 'react';
import {XYPlot, VerticalBarSeries} from 'react-vis';

function GraphDisplay(props) {
    return(
        <XYPlot 
            height={props.height} 
            width={props.width}
        >
            <VerticalBarSeries 
                data={props.data} 
                animation
                colorType="literal"
                fill="lightblue"
                stroke="lightblue"
                barWidth={0.9}
            />
      </XYPlot>
    );
}

export default GraphDisplay;
